import React from "react";
import './upperbody.css'
import '..//assets/images/sample.png'

export default function UpperBody() {
    let upperbodyStyle = {
        margin: '0px',
        position: "absolute",
        width: "100%",
        height: '50vh',
        backgroundImage: `url("sample.png")`
}
    return(
        <div style={upperbodyStyle} >
            <h1>UpperBody</h1>
        </div>
    )
}
